                "cater_tag": "牛头好吃 环境好 价格适中 ",
                "comment": ["这是一家集娱乐，吃饭，住宿一体的一个庄园，过年大家下午来这里订了一个棋牌室，一间棋牌室有两个麻将桌300块玩一个下午蛮好的，旁边还有体育中心可以打球，锻炼。晚上有很大餐厅可以吃饭，逛了一圈有好多包房，我们订了15个人的包房，据说还有更大的包房，人多倒是个好去处，他们家有个特色牛头很好吃，需要提前预定，鳝桶，杂鱼煲都很不错，量也很大，就是花雕鸡不是很好吃太甜了。开车去还比较方便，下次再去"],
